var ColorManager=function(){this.generateColorCode=function(h,m){var r=[];try{if(h<1){throw"{$gen_cnt} must be an integer greater than or equal to 1."}if(!m.match(/^#[0-9a-f]{6}$/i)){throw"The format of {$base_color} is invalid. Please specify it with 6 hexadecimal digits."}var g=this.__hexToRgb(m);var l=Math.max.apply(null,g);var i=Math.min.apply(null,g);var b=Math.floor(((l-i)*6)/h);if(b<1){b=1}var o=g.indexOf(l);var p=g.indexOf(i);switch(o){case 0:var k=0;if(p===1){var s=2;var u=1}else{var s=1;var u=2}break;case 1:var k=1;if(p===0){var s=2;var u=0}else{var s=0;var u=2}break;case 2:var k=2;if(p===0){var s=1;var u=0}else{var s=0;var u=1}break}var d=[s,k,u];var c=g;var j=0;var a=false;var f=s;var v=k;var n=b;var t="";if(c[s]-i>l-c[s]){a=true}while(r.length<h){if(c[s]==c[k]&&c[k]==c[u]){r.push(this.__rgbToHex(c))}else{if(n<1){n=1}if(a){if(c[f]+n>l){n=n-(l-c[f]);c[f]=l;f=this.__getNextIndex(f,d);a=false}else{c[f]=c[f]+n;t=this.__rgbToHex(c);if(r.indexOf(t)<0||j>2){r.push(t);j=0}else{j++}n=b}}else{if(c[f]-n<i){n=n-(c[f]-i);c[f]=i;f=this.__getNextIndex(f,d);a=true}else{c[f]=c[f]-n;t=this.__rgbToHex(c);if(r.indexOf(t)<0||j>2){r.push(t);j=0}else{j++}n=b}}}}return r}catch(q){console.log(q);return[]}};this.__hexToRgb=function(a){return[parseInt(a.substr(1,2),16),parseInt(a.substr(3,2),16),parseInt(a.substr(5,2),16)]};this.__rgbToHex=function(c){var e=parseInt(c[0]).toString(16);if(e.length==1){e="0"+e}var d=parseInt(c[1]).toString(16);if(d.length==1){d="0"+d}var a=parseInt(c[2]).toString(16);if(a.length==1){a="0"+a}return"#"+e+d+a};this.__getNextIndex=function(a,b){switch(a){case b[0]:return b[1];case b[1]:return b[2];case b[2]:return b[0]}}};
